" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 542px\">",
"   <div class=\"ttl\">",
"    RANKL and ROS-activated signals affecting the genesis and lifespan of osteoclasts",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 522px; height: 450px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In osteoclast precursors, RANKL-induced activation of RANK stimulates NFATc1 activation via cFOS/AP-1 and CREB. In addition, mitochondria biogenesis coupled with activation of the transferrin receptor by the iron-tranferrin complex stimulates mitochondria respiration and reactive oxygen species (ROS) production, which are also essential for osteoclast activation.",
"    <div class=\"footnotes\">",
"    </div>",
