var title_f40_45_41692="Medicare resources PI";
var content_f40_45_41692=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F60545&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F60545&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Help with understanding and choosing a Medicare Part D plan",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        These Web sites are only for people on Medicare",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Medicare:",
"        </strong>",
"        This is the official government Web site that lists the different drug plans Medicare offers. Here you can compare the plans offered in your state and view each plan's formulary (list of covered drugs).",
"        <ul>",
"         <li>",
"          General site:",
"          <a href=\"file://www.medicare.gov\" target=\"_blank\">",
"           www.medicare.gov",
"          </a>",
"         </li>",
"         <li>",
"          Site with information on state help with drug payment (how to contact each program, who is eligible, and other details you should know):",
"          <a href=\"https://www.medicare.gov/pharmaceutical-assistance-program/state-programs.aspx\" target=\"_blank\">",
"           https://www.medicare.gov/pharmaceutical-assistance-program/state-programs.aspx",
"          </a>",
"         </li>",
"         <li>",
"          Phone: 1-800-MEDICARE (1-800-633-4227)",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Medicare Rights Center:",
"        </strong>",
"        This is an independent non-profit consumer advocacy group that helps people navigate the Medicare system. The group offers a hotline with counselors who can answer questions and help you make the most out of your Medicare coverage.",
"        <ul>",
"         <li>",
"          Web site:",
"          <a href=\"file://www.medicarerights.org\" target=\"_blank\">",
"           www.medicarerights.org",
"          </a>",
"         </li>",
"         <li>",
"          Phone: 1-800-333-4114",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Medicare Saver:",
"        </strong>",
"        This interactive Web site makes specific suggestions about ways you can cut costs based on where you live and which medicines you take. For instance, if a drug you're taking has a less expensive version, the site alerts you and offers to write a letter for your doctor with the name of the cheaper medicine. Then it saves a version of the letter on your computer. You enter your information anonymously, but if you allow the site to write a letter, it does put information on your own computer.",
"        <ul>",
"         <li>",
"          Web site:",
"          <a href=\"file://www.medicaresaver.com\" target=\"_blank\">",
"           www.medicaresaver.com",
"          </a>",
"         </li>",
"         <li>",
"          Phone: 1-800-480-4165",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Social Security Extra Help Program:",
"        </strong>",
"        Only for people with Medicare, this official government site has information about the Extra Help program. The Extra Help program helps people pay for the costs: monthly premiums, annual deductibles, and prescription co-payments: related to a Medicare prescription drug plan.",
"        <ul>",
"         <li>",
"          Web site:",
"          <a href=\"file://www.ssa.gov/prescriptionhelp\" target=\"_blank\">",
"           www.ssa.gov/prescriptionhelp",
"          </a>",
"         </li>",
"         <li>",
"          Site with information about applying to the Extra Help program:",
"          <a href=\"file://www.ssa.gov/pubs/10525.html\" target=\"_blank\">",
"           file://www.ssa.gov/pubs/10525.html",
"          </a>",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         SHIP: State Health Insurance Assistance Program:",
"        </strong>",
"        SHIP is a national program that offers counseling and help to people with Medicare and their families. This site can help you find a counselor in your area who will meet with you one on one and talk to you about your Medicare options.",
"        <ul>",
"         <li>",
"          Web site:",
"          <a href=\"file://www.shiptalk.org\" target=\"_blank\">",
"           www.shiptalk.org",
"          </a>",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
