var title_f40_45_41693="Fluvastatin event free survival";
var content_f40_45_41693=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F76372&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F76372&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Fluvastatin improves outcome in patients with a low HDL cholesterol",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 394px; height: 429px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Kaplan-Meier curves show that in patients with a low HDL cholesterol (HDL-C &lt;35 mg/dL) fluvastatin therapy prolongs the time to first clinical event (revascularization, myocardial infarction, hospitalization for unstable angina, or all-cause mortality) and improves event-free survival compared to placebo (p = 0.002) (upper panel). Fluvastatin had no effect on event-free survival in patients with HDL-C &ge;35 mg/dL (lower panel).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Ballantyne, CM, Herd, JA, Ferlic, LL, et al. Circulation 1999; 99:736.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
